import addHistoryMethod from "./history-observe";

export class NetworkCheck {
  constructor({
    XHRCheck = false,
    XHRCheckByRouteChange = false,
    XHRDelay = 5000,
  }) {
    // 展示的离线页面id
    this.offlinePageId = "offlinePage";
    // 离线图表（断网后加载不出来，所以用base64）
    this.offlineIcon = this.base64Img();
    // 是否启用xhr请求检测离线（使用navigator.onLine检测无效，所以需要用请求判断）
    this.XHRCheck = XHRCheck;
    // 检测是否离线使用的url地址
    this.checkOfflineUrl = "/network-check.png";
    // 是否切换路由时xhr检测离线
    this.XHRCheckByRouteChange = XHRCheckByRouteChange;
    // xhr请求间隔
    this.XHRDelay = XHRDelay;
    this.isOnline = true;
    this.init();
  }

  init() {
    this.addHandler(window, "online", () => {
      this.removeOfflineHtml();
    });
    this.addHandler(window, "offline", () => {
      this.createOfflineHtml();
    });
    window.refresh = this.refresh.bind(this);
    window.addHistoryListener = addHistoryMethod("historychange");
    history.pushState = addHistoryMethod("pushState");
    history.replaceState = addHistoryMethod("replaceState");
    window.addEventListener("popstate", this.routeChange.bind(this));
    window.addHistoryListener("history", this.routeChange.bind(this));
    if (this.XHRCheck && !this.XHRCheckByRouteChange) {
      this.loopXHRCheck();
    }
  }

  async routeChange() {
    if (this.XHRCheckByRouteChange) {
      this.isOnline = await this.sendXHRCheck();
    }
    this.refresh();
  }

  createOfflineHtml() {
    if (document.getElementById(this.offlinePageId)) return;
    const div = document.createElement("div");
    div.id = this.offlinePageId;
    div.innerHTML = `
      <div onclick="refresh()" style="background: #fff; cursor: pointer;display: flex;flex-direction: column;justify-content: center;align-items: center;position: fixed;width: 100vw;z-index:9999999;left: 0;right: 0;bottom: 0;top: 0;">
        <img style="width: 13vw;min-width:180px" src="${this.offlineIcon}"/>
        <div style="font-size: 16px;color: #333333;line-height: 22px;margin-bottom: 50px">网络罢工了，请点击重新加载</div>
        <button
          class="h-button h-button--primary"
          >重新加载</button
        >
      </div>
    `;
    document.body.append(div);
  }

  removeOfflineHtml() {
    const offlinePage = document.getElementById(this.offlinePageId);
    if (!offlinePage) return;
    offlinePage.parentNode.removeChild(offlinePage);
  }

  refresh() {
    const condition = this.XHRCheck ? this.isOnline : navigator.onLine;
    condition ? this.removeOfflineHtml() : this.createOfflineHtml();
  }

  addHandler(element, type, handler) {
    if (element.addEventListener) {
      element.addEventListener(type, handler, false);
    } else if (element.attachEvent) {
      element.attachEvent("on" + type, handler);
    } else {
      element["on" + type] = handler;
    }
  }

  loopXHRCheck() {
    setInterval(async () => {
      this.isOnline = await this.sendXHRCheck();
      this.refresh();
    }, this.XHRDelay);
  }

  async sendXHRCheck() {
    try {
      const res = await fetch(
        this.checkOfflineUrl + "?t=" + new Date().getTime()
      );
      return res.status >= 200 && res.status < 300;
    } catch (err) {
      return false;
    }
  }

  base64Img() {
    return "data:image/png;base64,";
  }
}

export function setupNetworkCheck() {
  new NetworkCheck({
    XHRCheck: true, // 开启接口请求检测离线
    XHRCheckByRouteChange: true, // 路由切换时使用xhr检测，否则采用定时器检测
  });
}
